import React, { useState, useEffect } from 'react';
import { Link, useParams, useNavigate } from 'react-router-dom';
import { Form, Button } from 'react-bootstrap';
import { useDispatch, useSelector } from 'react-redux';
import Message from '../components/Message';
import Loader from '../components/Loader';
import FormContainer from '../components/FormContainer';
import {
  getTraineeDetails,
  updateTrainee,
} from '../redux/actions/traineeActions';
import { TRAINEE_UPDATE_RESET } from '../redux/constants/traineeConstants';

const TraineeEditScreen = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [department, setDepartment] = useState('');
  const [password, setPassword] = useState('');

  const dispatch = useDispatch();

  const traineeDetails = useSelector((state) => state.traineeDetails);
  const { loading, error, trainee } = traineeDetails;

  const traineeUpdate = useSelector((state) => state.traineeUpdate);
  const {
    loading: loadingUpdate,
    error: errorUpdate,
    success: successUpdate,
  } = traineeUpdate;

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  useEffect(() => {
    if (!userInfo || userInfo.role !== 'admin') {
      navigate('/login');
      return;
    }

    if (successUpdate) {
      dispatch({ type: TRAINEE_UPDATE_RESET });
      navigate('/admin/traineelist');
    } else {
      if (!trainee.name || trainee._id !== id) {
        dispatch(getTraineeDetails(id));
      } else {
        setName(trainee.name);
        setEmail(trainee.email);
        setDepartment(trainee.department);
      }
    }
  }, [dispatch, navigate, id, trainee, successUpdate, userInfo]);

  const submitHandler = (e) => {
    e.preventDefault();
    dispatch(
      updateTrainee({
        _id: id,
        name,
        email,
        department,
        password: password ? password : undefined,
      })
    );
  };

  return (
    <>
      <Link
        to="/admin/traineelist"
        className="btn my-3"
        style={{
          backgroundColor: 'var(--secondary-color)',
          borderColor: 'var(--border-color)',
          color: 'var(--text-color)',
          fontWeight: '500'
        }}
      >
        <i className="fas fa-arrow-left me-2"></i>
        Go Back
      </Link>
      <div style={{
        backgroundColor: 'white',
        padding: '2rem',
        borderRadius: '10px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
        border: '1px solid var(--border-color)',
        marginBottom: '2rem',
        maxWidth: '800px',
        margin: '0 auto'
      }}>
        <FormContainer>
          <h1 style={{
            color: 'var(--accent-color)',
            textAlign: 'center',
            marginBottom: '2rem',
            fontWeight: 'bold'
          }}>
            <i className="fas fa-user-edit me-2"></i>Edit Trainee
          </h1>
        {loadingUpdate && <Loader />}
        {errorUpdate && <Message variant="danger">{errorUpdate}</Message>}
        {loading ? (
          <Loader />
        ) : error ? (
          <Message variant="danger">{error}</Message>
        ) : (
          <Form onSubmit={submitHandler} className="pb-3">
            <Form.Group controlId="name" className="mb-3">
              <Form.Label>Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter name"
                value={name}
                onChange={(e) => setName(e.target.value)}
              ></Form.Control>
            </Form.Group>

            <Form.Group controlId="email" className="mb-3">
              <Form.Label>Email Address</Form.Label>
              <Form.Control
                type="email"
                placeholder="Enter email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              ></Form.Control>
            </Form.Group>

            <Form.Group controlId="department" className="mb-3">
              <Form.Label>Department</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter department"
                value={department}
                onChange={(e) => setDepartment(e.target.value)}
              ></Form.Control>
            </Form.Group>

            <Form.Group controlId="password" className="mb-3">
              <Form.Label>Password</Form.Label>
              <Form.Control
                type="password"
                placeholder="Enter new password (leave blank to keep current)"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              ></Form.Control>
            </Form.Group>

            <Button
              type="submit"
              variant="primary"
              className="w-100 mt-4 py-2"
              style={{ fontSize: '1.1rem' }}
            >
              Update
            </Button>
          </Form>
        )}
        </FormContainer>
      </div>
    </>
  );
};

export default TraineeEditScreen;
